import React from "react";
import Col from "react-bootstrap/Col";
import {
  ImageGrid,
  StyledRow,
  StyledCol,
} from "../styled-components/ImagesGrid-styling";

export default function ImagesGrid(props) {
  if (props.images) {
    return (
      <StyledRow className='img-grid'>
        {props.images.map(function (image, index) {
          return (
            <StyledCol key={index}>
              <a href={image.src.original} target='_blank' rel='noreferrer'>
                <ImageGrid src={image.src.tiny} alt='related to the search' />
              </a>
            </StyledCol>
          );
        })}
      </StyledRow>
    );
  } else {
    return null;
  }
}
